import './App.css';
import './index.css';
import Navbar from './Navbar';
import Home from './home';
import Main from './utama'
import {BrowserRouter, Switch, Route} from 'react-router-dom';
function App() {
  return (
    <div className="bg-primary">
      <BrowserRouter>
      <Navbar />
      <Switch>
        <Route path="/" exact>
          <Home/>

        </Route>
        <Route path="/utama">

        <Main/>
        </Route>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
